import React from "react";
import styled from 'styled-components';
import {ButtonDemo} from "../button-demo";

const Star = styled.div`
  display: inline-block;
  position: absolute;
  font-size: 32.5px;
  top: 6px;
`

const Wrapper = styled.div`
  position: relative;
  margin: 50px 125.5px 0 125.5px;
  padding: 0 30px;
  h1 {
    line-height: 1.07;
  }
`
const H1Description = styled.div`
    font-size: 14px;
    line-height: normal;
    letter-spacing: 0;
    color: #202d3d;
    margin-top: 15px;
    font-weight: 400;
`

const Description = styled.div`
    margin-top: 35px;
    display: flex;
    flex-direction: column;
    width: 560px;
    p {
      margin: 18px 0 0 0;
    }
`
const ButtonsWrapper = styled.div`

`

export const About = () => {
    return (<Wrapper>
        <h1>
            Мобильный <span>ID<Star>*</Star></span>
        </h1>
        <H1Description>* Услуга предоставляется для юридических лиц.</H1Description>
        <Description>
            <p>Быстрая и безопасная авторизация на сайтах и приложениях партнеров с помощью мобильного телефона</p>
            <p>Универсальное решение проблемы забытых паролей и логинов, и автозаполнению данных.</p>
        </Description>
        <ButtonsWrapper>
            <ButtonDemo/>
        </ButtonsWrapper>
    </Wrapper>)
}
